    366.hopto.org
*/

@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document domain("piratskenoviny.cz"),
               domain("piratske-noviny.cz"),
               domain("pn.piratskasit.cz"),
               domain("piratskenovinky.cz") {

body{
  background: black !important;
  color: #CCCCCC !important;
}

a{
  color: #DDDDDD !important;
}

a:hover{
  color: #EEEEEE !important;
}


/* lista s obrazky nahore */
td[VALIGN="BOTTOM"][WIDTH="525"] div[align="right"] img{
  opacity: 0.5 !important;
}


/* obrazek velky nahore */
td[ALIGN="RIGHT"][VALIGN="TOP"][WIDTH="467"][HEIGHT="125"]{
  background:
    url(data:image/gif;base64,)
    no-repeat
    !important;
}


font[color="#000000"]{
  color: white !important;
}


/* logo pn dole */
img[src$="imgs/pn210.gif"]{
 height: 0 !important;
 width: 0 !important;
	
 padding-left: 215px !important;
 padding-top: 215px !important;

 background:
  url(data:image/png;base64,)
    no-repeat
    !important;
}


/* oramovani malych obrazku (prevazne na hl. strance) */
a[href*="?c_id="] img{
  border: 1px gray solid !important;
}


/* obrazek webarchivu */
img[src$="imgs/webarchiv_certifikat.gif"]{
 height: 0 !important;
 width: 0 !important;
	
 padding-left: 100px !important;
 padding-top: 100px !important;

 background:
  url(data:image/png;base64,)
    no-repeat
    !important;
}


/* obrazek vysilace */
img[src$="imgs/vysilac.jpg"]{
 height: 0 !important;
 width: 0 !important;
    
 padding-left: 114px !important;
 padding-top: 100px !important;

 background:
  url(data:image/png;base64,)
    no-repeat
    !important;
}


/* seznam clanku napravo (clanky v rubrice, atd.) */
td[BGCOLOR="#E4E4E4"]{
  background: #0F0F0F !important;
}


/* "Pedvolebn hlasovac ankety" obrazek grafu */
img[src="/imgs/votegraf.gif"], img[src="imgs/discussion.gif"]{
  opacity: 0.7 !important;
}


/* obracene "c" */
img[src="imgs/copyleft.gif"] {
  height: 0 !important;
  width: 0 !important;
    
  padding-left: 12px !important;
  padding-top: 12px !important;

  background:
    url(data:image/png;base64,)
    no-repeat
    !important;
}


/* mala vlajka dole */
img[SRC="imgs/index.gif"]{
  height: 0 !important;
  width: 0 !important;
    
  padding-left: 20px !important;
  padding-top: 20px !important;

  background:
    url(data:image/png;base64,)
    no-repeat
    !important;
}


/* facebook */
iframe[src*="facebook.com"]{
  opacity: 0.3 !important;
}
iframe[src*="facebook.com"]:hover{
  opacity: 1 !important;
}

/* pozadi komentaru */
tr[bgcolor="#DDDDDD"]{
  background: #101010 !important;
}


img[border="1"]{
  border: 1px gray solid !important;
}


/* ikonka pn na twitteru */
img[SRC="imgs/pw.gif"]{
  height: 0 !important;
  width: 0 !important;
    
  padding-left: 16px !important;
  padding-top: 16px !important;

  background:
    url(data:image/png;base64,)
    no-repeat
    !important;
}

table[BORDER="0"][CELLSPACING="0"][CELLPADDING="0"][COLS="1"][WIDTH="100%"][BGCOLOR="#C0C0C0"]{
  background: #111 !important;
}

td[STYLE="background-color: rgb(255, 255, 204); background-image: none; text-align: left; vertical-align: top; border-style: none;"]{
  background: #111 !important;
}

table[style="width: 45%; background-color: rgb(255, 255, 255); background-image: none; float: left; text-align: left; vertical-align: top; border-style: none; margin-left: 0px; margin-right: auto; border-width: 1px;"]{
  background: black !important;
}

/* anketa a reklama vpravo */
TABLE[width="100%"] td[bgcolor="#FFFFFF"]{
  background: #101010 !important;
}

table[style="width: 100%; background-color: rgb(255, 255, 204); background-image: none; border-width: 5px; float: none; text-align: left; vertical-align: top; border-style: inset;"]{
  background: black !important;
}

/* petice */
td[bgcolor="#d5dcef"]{
  background: #202020 !important;
}

table[style="width: 100%; background-color: rgb(255, 255, 204); background-image: none; border-width: 1px; float: none; text-align: left; vertical-align: top; border-style: dashed;"]{
  background: #202020 !important;
}

table[style*="background-color: rgb(255, 255, 204)"]{
  background: #202020 !important;
}

/* end */
}
